        <img src={props.imgsrc}
         alt="myPic" className="card_img" />
        <div className="card_info">
        <span className="card_category">A Netflix Orignal</span>
        <h3 className="card_title">Into the Night</h3>
        <a href="" target="_blank">
          <button>Watch Now</button>
        </a>

        </div>

      </div>

    </div>



    </>

  )

}

ReactDOM.render(
  <>
